import React, { Component } from 'react'

class AdminForm extends Component {
    constructor (props) {
        super(props)
        const data = this.props.data
        this.state = { data }
      }
  render () {
    return (
      <section>
        <textarea
          rows='10'
          value={this.props.data.content}
        />
      </section>
    )
  }
}
export default AdminForm
